import './App.css';

import 'weather-icons/css/weather-icons.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Weather from './app_component/weather.component';

const API_KEY = '3d29191ea23f22a6b9c9ab55a3e1096e';

class App extends React.Component {
  constructor(){
    super();
      this.state = {};
      this.getWeather();
  }

  getWeather = async () => {
    const api_data = await fetch(`http://api.openweathermap.org/data/2.5/weather?q=Kerala,india&apiid=${API_KEY}`)

    const response  = await api_data.json();

    console.log(response)
  }

  state = {}
  render () {
    return (
      <div className="App">
      <Weather/>
      </div>
    )
  }
}

export default App;
